def get_stock_name(st):
    stock_info = yf.Ticker(st)
    info = stock_info.info
    stock_name = info.get('shortName', 'x')
    try:
        stock_name = stock_name.replace("'", "\\'")
    except:
        stock_name = 'x'

    return stock_name

